    def doit(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        nums.sort()
        diff = []
        for i in range(len(nums)-1):
            diff.append([])
            for j in range(i+1, len(nums)):
                c = nums[j] - nums[i]
                diff[i].append(c)
        

        A, val = [], -1
        def push(i, j):
            if i < len(diff) and j < len(diff[i]):    
                heapq.heappush(A, [diff[i][j], i, j])

